import style from './EmailForm.module.css'

const EmailForm = () => {
  return (
    <div className={style.emailForm}>
      <div className={style.leftDarkSide}></div>
      <div className="frameText">Оставайся на связи:
</div>
      <div className="emailForm"></div>
      <div className={style.rightDarkSide}></div>
    </div>
  )
}

export default EmailForm
